import React from 'react';
import { Myname, Lname } from './Context';

export const App1 = () => {
    return (
        <>
            <Myname.Consumer>{(fname) => {
                return (
                    <Lname.Consumer>{(lname) => {
                        <h1>hello {fname} {lname}</h1>
                    }};
                    </Lname.Consumer>
                        )


                    }}
            </Myname.Consumer>

        </>
    )
}

export default App1;
